import React from "react";
import "./App.scss";
import MainLayout from "./layouts/MainLayout";
import routes, { RenderRoutes } from "./routes";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
        <>{RenderRoutes(routes)}</>
      </BrowserRouter>
    </div>
  );
}

export default App;
